function Header(props) {
  let store = props.store;
  let gnb = [
    {
      navigate: -1,
      name: "üëàüèª"
    },
    {
      navigate: "/",
      name: "To Main"
    },
    {
      navigate: "/content1",
      name: "To Content1"
    }];

  return (
    <header>
      {
        gnb.map((v, i) => {
          return (
            <h1 key={i} onClick={() => {
              props.navigate(v.navigate);
              props.resetJW(`/${document.URL.split("/")[3].trim()}`);
            }}>
              { v.name }
            </h1>
          )
        })
      }

      <h1 onClick={() => {
        props.navigate("/");
        props.resetJW(`/${document.URL.split("/")[3].trim()}`);
      }}>
        To Main
      </h1>
      <h1 onClick={() => {
        props.navigate("/content1");
        props.resetJW(`/${document.URL.split("/")[3].trim()}`);
      }}>
        To Content1
      </h1>
    </header>
  )
}

export default Header;
